INSERT INTO `tb_news` VALUES ('64d6d8', '美国突然使出连环损招，释放了三个意味深长的信号！', '<p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">当然，作为一个看似积极的信号，莱特希泽也表示，美国仍准备与中国展开谈判。 美国媒体此前也披露，美国财政部长姆努钦和中国副总理刘鹤的代表，正就重启中美经贸磋商进行私下会谈。</span><br/></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　还有一个很有意思的细节。7月31日，在佛罗里达的一个集会上，特朗普特意谈到了美国农民的处境。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　“中国和其他国家，瞄准了我们的农民，这不好，这不妙。”特朗普说，“你知道我们的农民怎么说吗？那就OK吧，我们能够接受。”</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　特朗普自问自答，然后说：“我想谢谢我们的农民，我们的农民是真正的爱国者。”</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　特朗普说得很带劲，美国农民似乎“为有牺牲多壮志”，但这是真的吗？</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　情况可能恰恰相反，最不希望发动贸易战的，应该就是美国农民。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　路透社就评述说，特朗普之所以提到农民的困境，因为他也感受到这一问题的灼热。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　尽管为了平息农民的愤怒，特朗普政府宣布提供120亿美元救助，但“一些美国农民以及农业州的议员，甚至包括特朗普的共和党同僚，都谴责了这个（贸易战）行动，说：他们宁可不要政府援助，而是进行不加关税的贸易。”</span></p><p><br/></p>', '46d16f11112e4f909e469b7a382791a1.jpg', '2018-08-03 00:00:00', '2018-08-10 00:00:00', '美国突然又使出连环损招　还有一个很有意思的细节。7月31日，在佛罗里达的一个集会上，特朗普特意谈到了美国农民的处境。');
