0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　情况可能恰恰相反，最不希望发动贸易战的，应该就是美国农民。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　路透社就评述说，特朗普之所以提到农民的困境，因为他也感受到这一问题的灼热。</span></p><p style=\"margin-top: 0px; margin-bottom: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: \" microsoft=\"\" pingfang=\"\" lantinghei=\"\" hiragino=\"\" sans=\"\" wenquanyi=\"\" micro=\"\" font-size:=\"\" text-align:=\"\" white-space:=\"\" background-color:=\"\"><span style=\"font-size: 14px;\">　　尽管为了平息农民的愤怒，特朗普政府宣布提供120亿美元救助，但“一些美国农民以及农业州的议员，甚至包括特朗普的共和党同僚，都谴责了这个（贸易战）行动，说：他们宁可不要政府援助，而是进行不加关税的贸易。”</span></p><p><br/></p>', '46d16f11112e4f909e469b7a382791a1.jpg', '2018-08-03 00:00:00', '2018-08-10 00:00:00', '美国突然又使出连环损招　还有一个很有意思的细节。7月31日，在佛罗里达的一个集会上，特朗普特意谈到了美国农民的处境。');
INSERT INTO `tb_news` VALUES ('8086', '基于快速GeoHash，如何实现海量商品与商圈的高效匹配？', '<p>在数据库中，商圈是由多个点围成的面数据，这些面数据形状、大小各异，且互不重叠。商品是以 GPS 标记的点数据，如何能够快速高效地确定海量商品与商圈的归属关系呢？传统而直接的方法是，利用几何学的空间关系计算公式对海量数据实施直接的“点—面”关系计算，来确定每一个商品是否位于每一个商圈内部。<br/></p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: \" pingfang=\"\" helvetica=\"\" font-size:=\"\" line-height:=\"\" color:=\"\" white-space:=\"\" background-color:=\"\">　　闲鱼目前有 10 亿商品数据，且每天还在快速增加。全国所有城市的商圈数量总和大约为 1 万，每个商圈的大小不一，边数从 10 到 80 不等。如果直接使用几何学点面关系运算，需要的计算量级约为 2 亿亿次基本运算。按照这个思路，我们尝试过使用阿里巴巴集团内部的离线计算集群来执行计算，结果集群在运行了超过 2 天之后也未能给出结果。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: \" pingfang=\"\" helvetica=\"\" font-size:=\"\" line-height:=\"\" color:=\"\" white-space:=\"\" background-color:=\"\">　　经过算法改进，我们采用了一种基于 GeoHash 精确匹配，结合 GeoHash 非精确匹配并配合小范围几何学关系运算精匹配的算法，大大降低了计算量，高效地实现了离线环境下海量点-面数据的包含关系计算。同样是对 10 亿条商品和 1 万条商圈数据做匹配，可以在 1 天内得到结果。</p><p><span style=\"color:#404040;font-family:PingFang SC, Helvetica Neue, Helvetica, Arial, sans-serif\"><span style=\"font-size: 14px; background-color: rgb(250, 250, 250);\"></span></span><br/></p>', '35c9c19cfec44cfb9f73c03e16e65f9c.jpg', '2018-08-03 00:00:00', '2018-08-10 00:00:00', '闲鱼的商品是由用户发布的 GPS 随机分布在地图上的点数据。当用户处于某个商圈范围内时，app 会向用户推荐 GPS 位于此商圈中的商品。要实现精准推荐服务，就需要计算出哪些商品是归属于你所处的商圈。 ');
