INSERT INTO `tb_news` VALUES ('b74327266b07469c9508a1b8cde5dd6a', '历史转折中的“杭派工程师”', '<p>2018 年，杭州城的生活是这样的：萧山机场 T3 航站楼的安检员每扫描 3000 个瑞士双肩包，就有 2200 个装着写满代码的笔记本；阿里西溪园区的星巴克，销量号称亚洲 Top 3，一天至少卖出 200 杯焦糖玛奇朵；余杭区的出租车司机每天能拉到 13 个谈论 App 开发的乘客，收到的现金不会超过 100 块，还有老外举着美钞，求师傅给他的支付宝转点钱；西湖银泰的新白鹿，每卖出一盘开背虾，就有两瓶勇闯天涯被喝掉，而 10 桌客人有 3 桌会谈论物联网、大数据、AI、区块链……小到充电宝、漂流雨伞，大到无人超市、无人停车场，除了西湖轮渡只收现金，在杭州，几乎一切需求都可以扫码解决。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: \" pingfang=\"\" helvetica=\"\" font-size:=\"\" line-height:=\"\" color:=\"\" white-space:=\"\" background-color:=\"\">　　在君王、诗人、游客、商贾之后，如今，杭州城最风头无二的角色，非工程师莫属。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: \" pingfang=\"\" helvetica=\"\" font-size:=\"\" line-height:=\"\" color:=\"\" white-space:=\"\" background-color:=\"\">　　时代让他们站在了新一轮“历史转折”的中心：整个杭州，乃至整个中国都在进行一场技术升级。向规模要增长正转变为向技术要增长。</p><p style=\"margin-top: 10px; margin-bottom: 10px; padding: 0px; font-family: \" pingfang=\"\" helvetica=\"\" font-size:=\"\" line-height:=\"\" color:=\"\" white-space:=\"\" background-color:=\"\">　　在这一进程中，三代杭派工程师悉数亮相——死扛的、敢赌的、自信的，他们是被时代选中的，也是自我成就的。</p><p><span style=\"font-size: 14px;\"><br/></span><br/></p>', '39aa6a7a97de480a803a7a52d5386263.jpg', '2018-08-01 00:00:00', '2018-08-03 00:00:00', '余杭区的出租车司机每天能拉到 13 个谈论 App 开发的乘客，收到的现金不会超过 100 块，还有老外举着美钞，求师傅给他的支付宝转点钱；西湖银泰的新白鹿，每卖出一盘开背虾，');
