INSERT INTO `tb_project` VALUES ('332435cc3b2b4259abcde899904aed10', '042a34264d294ba7bb40dde1a70e881f', '杭州IT公园', '总建筑面积约20万平米，由公园独栋NEW创空间、跃层|+空间、景观高层WE创空间及配套商业组，,外揽3大生态湿地，內有双水岸原生水系环绕，闹中取静，环境优美，呈现难得的“大公园、小独栋”的生态办公氛围。', NULL, '浙江·杭州', '20万方', '“大公园、小独栋”生态办公', '2018-08-09 14:17:37');
INSERT INTO `tb_project` VALUES ('4866c6f2ff2044b68a35d6fa4c9037e4', 'c76c91628a294fadae27836705dacb41', '磐界星屋-小木桥创意产业园', '项目位置：上海市徐汇滨江小木桥路800号交通：4号线大木桥站400米、12号龙华中路站400米定位：创意设计办公', 'b6aad28a54f243aa8df2658d48d795f3.jpg', '上海·徐汇', '暂时没有项目标签信息', '创意设计办公', '2018-08-09 14:14:52');
INSERT INTO `tb_project` VALUES ('634d92aaf92141b09e0d001baa0d8a2b', '4db59a2742e145e890c2914effa88ef4', '磐界黄山未来科技城', '位于黄山经济开发区梅林大道59号,8万方的双生态科技园,，由黄山开发区委托磐界科技运营管理；全产业生态示范园区，搭载政府引导双创基金围绕入驻企业进行全方位金融扶持，聚集汽车电子、先进制造、人工智能、信息服务等 高新技术产业，为入驻企业提供以创客空间 + 孵化器 + 加速器功能配置三者合一的整合型创孵产业链。', 'd78041812b30472bbc47e7dcf7fda276.jpg', '安徽·黄山', '8万方双生态科技园', '为入驻企业提供以创客空间 + 孵化器 + 加速器功能配置三者合一的整合型创孵产业链', '2018-08-09 14:13:11');
INSERT INTO `tb_project` VALUES ('7aca9a3f62a24df2ad0bcfbb08f2ef76', '4db59a2742e145e890c2914effa88ef4', '无锡太湖智谷科技园', '<p style=\"line-height: 1.5em;\"><span style=\"font-family: 微软雅黑,Microsoft YaHei;\">占地约100亩，建筑面积18万平米，位于无锡城市副中心滨湖区，紧邻滨湖区政府服务中心，环境优美，地理位置优越。无锡太湖智谷项目作为无锡市政府城市升级、产业回归的载体，为二产企业的生产、办公提供了良好的场所。项目由城市厂房、研发楼宇、企业总部及商业配套等多业态构成，旨在搭建科创企业成长平台，打造优质企业集聚高地。</span></p>', NULL, '江苏·无锡', '占地100亩，建筑面积18万方', '搭建科创企业成长平台，打造优质企业集聚高地', '2018-08-09 19:57:35');
INSERT INTO `tb_project` VALUES ('8355b0fad237427fbd0479d4e5d3317f', '042a34264d294ba7bb40dde1a70e881f', '上海龙软信息服务外包产业园', '位于静安区万荣路1188号，总建筑面积近4万方。由闸北区与龙软集团共建的核心园区，也是上海首家市级专业软件服务外包园区和闸北区首家软件园。龙软园区于2006年开始改造，2008年10月16日由杨雄市长揭牌正式开园。经过近10年的运营，龙软园区注册企业473家，入驻企业151家，2017年产值达170亿，产税突破4亿。上海市科技企业孵化器、上海市信息服务产业基地、上海市中小企业服务机构、上海市版权示范基地等，“小规模、大产值”上海“百亿园区”示范基地。', '1ba5b070d4df4aeaab3a2db78beb1bbc.jpg', '上海·静安', '4万方，产税突破4亿', '上海首家市级专业软件服务外包园区和闸北区首家软件园', '2018-08-09 14:16:05');
INSERT INTO `tb_project` VALUES ('93c3112929034ad2949fc29eb542731e', 'c76c91628a294fadae27836705dacb41', '磐界星屋-大宁国际广场', '项目位置：上海市静安区共和新路1878号交通：1号线延长路站50米', 'cd440a23b8934588994f29dcd77b366e.jpg', '上海·静安', '暂时没有项目标签信息', '暂时没有项目定位信息', '2018-08-09 18:50:19');
INSERT INTO `tb_project` VALUES ('a09929b5d1324cc081b8c8b62b9941dc', 'c76c91628a294fadae27836705dacb41', '磐界星屋-峻岭广场', '项目位置：上海市黄浦区成都北路500号交通：2号线人民广场站30米', 'b91afae203c342ed8f535cb03986f1ab.jpg', '上海·黄浦', '暂时没有项目标签信息', '暂时没有项目定位信息', '2018-08-09 14:20:51');
INSERT INTO `tb_project` VALUES ('aa78b03e5e044834827e688bef6fdd7f', '4db59a2742e145e890c2914effa88ef4', '南通磐界数据中心', '由南通软秦数据有限公司投资，占地20亩，总投资3亿人民币，建设2600个标准数据中心机柜。项目于2018年4月开工建设， 2019年初建成投入营运。', '83b0f452277042aeaf00ac789c947420.jpg', '江苏·南通', '占地20亩，总投资3亿人民币，建设2600个标准数据中心机柜', '数据中心', '2018-08-09 14:13:23');
INSERT INTO `tb_project` VALUES ('c60f5a33d2d8463aaf1d932fe4028384', '7e243086dd524721854729050589a5d1', '上海龙软信息服务外包产业园', '<p><span style=\"font-size:16px;font-family:&#39;微软雅黑&#39;,&#39;sans-serif&#39;\">位于原闸北现静安区万荣路1188号，总建筑面积近4万方。由闸北区与龙软集团共建的核心园区，也是上海首家市级专业软件服务外包园区和闸北区首家软件园。龙软园区于2006年开始改造，2008年10月16日由杨雄市长揭牌正式开园。经过近10年的运营，龙软园区注册企业473家，入驻企业151家，2017年产值达170亿，产税突破4亿。上海市科技企业孵化器、上海市信息服务产业基地、上海市中小企业服务机构、上海市版权示范基地等，“小规模、大产值”上海“百亿园区”示范基地。</span></p><p><span style=\"font-size: 14px;\"></span><br/></p>', '60250d0d19a24297ba8e753db674d253.jpg', NULL, NULL, NULL, NULL);
INSERT INTO `tb_project` VALUES ('c6907f753be1496b91db677191624a89', '9d951cfd9870466dbf4b20bd819b5cf9', '青山湖科技城IM汇', '青山湖IM汇面积5000方，位于青山湖科技城管委会园区内的独幢，青山湖科技城是浙江建设科技强省和创新型省份的重大工程，也是杭州城西科创大走廊、杭州国家自主创新示范区的重要组成部分。青山湖科技城规划面积115平方公里，分为四大功能区。研发区面积5平方公里，启动区块面积2.07平方公里，是科技城核心，建成后将集聚大批科研机构和研发人才。产业化区面积40平方公里，是高端产业和高新企业的集聚地。现代服务和综合生活配套区面积25平方公里，是企业总部、中介机构、现代服务业的集聚地。生态休闲区面积45平方公里，将围绕青山湖适度开发生态休闲旅游业。', '10227dd254074aa691ce132defb2eca8.jpg', '浙江·杭州·青山湖科技城', '5000方独栋', '孵化器', '2018-08-09 19:36:04');
INSERT INTO `tb_project` VALUES ('ced029db38b14031a3232a22c386029c', '4db59a2742e145e890c2914effa88ef4', '南通长江智谷', '长江智谷，位踞南通市长泰路东，城北大道南，南通科技城内，总占地约427亩，总建筑面积约45万平方。一期指标：规划用地约10万平方，总建筑面积约17万平方。建筑类型：独栋办公、总部办公、LOFT办公、产业孵化器、加速器、商服配套。特点：以“自然生态+产业链生态”双生态主题发展理念，卓越的产业环境，绿色产业空间，创新服务平台和优势扶持政策，打造南通首府双生态科技园。', '30ab7660f05c49afadac1645f5facd18.jpg', '江苏·南通', '占地427亩、总建筑面积45万方', '打造南通首府双生态科技园', '2018-08-09 19:48:33');
INSERT INTO `tb_project` VALUES ('d0a43cd6a361466485fa33bc95de0185', '4db59a2742e145e890c2914effa88ef4', '黄山智谷科技园', '项目区位优越，占据机场和高铁站的夹角之势，具有便捷的交通优势。园区临近黄山风景区，周边景观资源丰富，旨在打造自然、产业、旅游、生态相和谐的产业园典范。黄山智谷科技园总规划用地面积约300亩，容积率1.0，总建筑面积近20万方，建成后将形成一个集现代化产业园区、高端居住、精品酒店为一体的产城融合项目。', NULL, '安徽·黄山', '占地300亩', '形成一个集现代化产业园区、高端居住、精品酒店为一体的产城融合项目', '2018-08-09 11:52:01');
INSERT INTO `tb_project` VALUES ('d8b164aa5dcb45d3ae1f868bf8187432', 'c76c91628a294fadae27836705dacb41', '磐界星屋-远东国际广场', '项目位置：上海市长宁区仙霞路319号交通：2号线娄山关路站500米', '021a3b122b1a45cc8a5be31406343b97.jpg', '上海·长宁', '联合办公', '暂时没有项目定位信息', '2018-08-09 14:16:26');
INSERT INTO `tb_project` VALUES ('dcc27a0472404665b1796eb5f2186111', '042a34264d294ba7bb40dde1a70e881f', '嘉善信息科技城', '位于嘉善国家级经济开发区，西靠善江公路，北依台升路，地理位置十分优越。园区总规划用地134亩，建筑面积15万平方米，总投资4.8亿元，分别为50幢科研楼和1幢配套楼。项目主要建成以软件研发、互联网电子商务、云计算及物联网技术应用以及国际IT服务外包、科技园区开发管理等信息科技产业园。', NULL, '浙江·嘉兴', '15万方，总投资4.8亿', '信息科技产业园', '2018-08-09 14:16:44');
INSERT INTO `tb_project` VALUES ('fb5831654a5649a898d08bd4614f1b61', '9d951cfd9870466dbf4b20bd819b5cf9', '华创IM汇', '华创IM汇位于城西科创大走廊核心的人工智能小镇12号楼7-9楼，面积约2000方。目前入驻项目包括浙江省智能诊疗设备创新中心、阿里巴巴创新中心（杭州海创园）项目、微软加速器、百度创新中心、哈工大机器人-杭州致知科创园、腾讯创智中心、赛翁斯科技、中兴智能产业项目等。未来科技城人工智能小镇将以人工智能为特色，覆盖大数据、云计算、物联网等业态，集中力量招引机器人、智能可穿戴设备、无人机、虚拟/增强现实、新一代芯片设计研发等领域，集聚一批人工智能领域高精尖人才，全力打造成为具有全球顶尖特色的人工智能小镇。', '74b8a39377444d98b3b25485bb5ee3c1.jpg', '浙江·杭州·人工智能小镇', '智能制造', '孵化器', '2018-08-09 19:34:43');
INSERT INTO `tb_series` VALUES ('042a34264d294ba7bb40dde1a70e881f', '龙软系列', '<p>上海龙软信息服务外包产业园、嘉善信息科技城、杭州IT公园</p>', NULL, '2018-08-10 14:36:26');
INSERT INTO `tb_series` VALUES ('4db59a2742e145e890c2914effa88ef4', '磐界系列', '<p>南通磐界数据中心、南通长江智谷、无锡太湖智谷科技园、磐界黄山未来科技城、黄山智谷科技园</p>', NULL, '2018-08-10 14:37:48');
INSERT INTO `tb_series` VALUES ('9d951cfd9870466dbf4b20bd819b5cf9', 'IM汇系列', '<p><span style=\"font-size:16px;font-family:&#39;微软雅黑&#39;,&#39;sans-serif&#39;\">IM汇（Intelligent Manufacturing Space，IM Space）是以华友系为基础发展起来的，专注于中国智造2025（工业4.0）方向的垂直孵化器。以<strong>人工智能、高端装备、物联网、云计算和工业大数据</strong>领域的技术孵化为核心，通过人才培养，搭建项目和实验平台，整合企业、高校、科研机构等资源，配套产业基金及企业级服务，构建原创科技的策源中心，行业技术进步的促进中心，大企业的技术创新中心，中小企业的产品创新中心。<span style=\"font-family: 微软雅黑, sans-serif; font-size: 14px;\"></span></span></p><p><br/></p>', NULL, '2018-08-08 11:08:37');
INSERT INTO `tb_series` VALUES ('c76c91628a294fadae27836705dacb41', '磐邑系列', '<p><span style=\"font-size: 14px;\"><span style=\"font-family: 微软雅黑, sans-serif;\">磐界星屋，专为科创团队量身打造的创客空间，</span><span style=\"font-family: 微软雅黑, sans-serif;\">定位于精致的轻资产、轻体量的高端办公空间。区域性商圈核心地段，满足您对创业生态的所有需求。</span></span></p><p><br/></p>', NULL, '2018-08-08 12:08:11');
